import React from "react";

const DeleteButton = ({ color, text, onClick, taskId }) => {
    const handleClick = () => {
        onClick(taskId);
    };

    return (
        <button className="delButoon" onClick={handleClick} style={{ backgroundColor: color }} type='submit' className='My-button'>
            {text}
        </button>
    );
};

export default DeleteButton;
